import React, { Component } from 'react';
import { NavLink } from 'react-router-dom';
import axios from 'axios';
import './manageNetwork.scss';
import 'rsuite/dist/styles/rsuite-default.css';


import {
    Grid,
    Button,
    Dialog,
    DialogTitle,
    DialogContent,
    DialogActions,
    FormControl,
    Select,
    MenuItem
} from "@material-ui/core";
import * as Icons from "@material-ui/icons";
import { Timeline } from 'rsuite';


import Widget from "../../components/Widget";

import ArrowBlue from '../../images/home/arrow_blue.svg';
import loadingIcon from '../../images/home/loading.gif';

import apiService from '../../services/apiService';

class MonitorNetwork extends Component {

    constructor(props) {
        super(props);

        this.state = {
            addSubsciberFormStatus: false,
            subscribersListStatus: false,
            ns_id: '', ns_supi: '', ns_auth_method: '', ns_k: '', ns_operation_code_type: '', ns_operator_code_value: '',
            addSubscriberError: '',
            subscribersList: [],
            callUnderProgress: false,
            deleteingUeid: '',
            modifyUeid: '',
            operationType: 'add', editSubscriberData: null,
            suggestedActionButton: null
        }

        this.getSubscribersToken = null;
        this.addSubsciberToken = null;
        this.deleteSubsciberToken = null;
        this.modifySubscriberToken = null;
        this.suggestedActionTOken = null;
        this.suggestedActionSubmitTOken = null;

        this.timeout = null;

        this.defaultValues = {
            ns_id: 'ue1',
            ns_supi: 'imsi-208930000000003',
            ns_auth_method: '5G-AKA',
            ns_k: '8baf473f2f8fd09487cccbd7097c6862',
            ns_operation_code_type: 'opc',
            ns_operator_code_value: '8e27b6af0e692e750f32667a3b14605d'

        }

    }

    componentWillMount() {
        this.setDefaultValues();
        this.suggestedActionUeCheck();
        this.timeout = setInterval(this.intiateCall, 5000);
    }

    intiateCall = () => {
        if (!this.state.callUnderProgress) {
            this.suggestedActionUeCheck();
        }
    }

    componentWillUnmount() {
        if (this.suggestedActionTOken)
            this.suggestedActionTOken.cancel();
        clearInterval(this.timeout);
    }

    setDefaultValues = () => {
        var thisView = this;
        Object.keys(this.defaultValues).map((eachKey, index) => {
            this.setState({[eachKey]: thisView.defaultValues[eachKey]});
        });
        if(this.state.operationType === "edit"){
            this.setState({ns_supi: this.state.editSubscriberData.ueId});
        }
    }

    toggleSubscriber = (operationType) => {
        this.setState({addSubsciberFormStatus: !this.state.addSubsciberFormStatus, operationType: operationType ? operationType : "edit"});
        this.setDefaultValues();
        this.setState({addSubscriberError: ''});
    }

    toggleSubscribersList = () => {

        if(!this.state.subscribersListStatus){
            this.getSubscribersList();
        }
        this.setState({subscribersListStatus: !this.state.subscribersListStatus});
    }

    handleChange = (event) => {
        this.setState({[event.target.name]: event.target.value});
    }

    handleChangeOperationCode = (event) => {
        this.setState({ns_operation_code_type: event.target.value})
    }

    addNewSubscriber = () => {

        const { ns_id, ns_supi, ns_auth_method, ns_k, ns_operation_code_type, ns_operator_code_value } = this.state;

        let data = {
            id: ns_id,
            supi: ns_supi,
            auth_method: ns_auth_method,
            k: ns_k,
            operation_code_type: ns_operation_code_type,
            operator_code_value: ns_operator_code_value
        }

        if(data.id === '' || data.supi ==='' || data.auth_method === '' || data.auth_method === '' 
                    || data.k === '' || data.operation_code_type === '' || data.operator_code_value === ''){
                        this.setState({addSubscriberError: 'Please fill all details'});
        } else {
            this.setState({addSubscriberError: ''});

            if(this.state.operationType === 'add'){
                this.addSubscriber(data);
            } else {
                console.log(data);
                this.modifySubscriber(data);
            }

        }
    }

    addSubscriber = (data) => {

        var thisView = this;
        if (this.addSubsciberToken)
            this.addSubsciberToken.cancel();
        this.addSubsciberToken = axios.CancelToken.source();

        this.setState({callUnderProgress: true});
        axios.all([apiService.addSubscriber(this.addSubsciberToken.token, data)])
            .then(function (res) {
                if (res[0]) {
                    thisView.setState({addSubscriberError: ''});
                    thisView.setDefaultValues();
                    thisView.toggleSubscriber();
                    thisView.setState({callUnderProgress: false});
                }
            }).catch(function (res) {
                console.log(res);
                console.log('An error occurred add subscriber element service');
                thisView.setState({callUnderProgress: false});
            });

    }

    deleteSubscriber = (subscriberData) => {

        var thisView = this;
        if (this.deleteSubsciberToken)
            this.deleteSubsciberToken.cancel();
        this.deleteSubsciberToken = axios.CancelToken.source();

        this.setState({deleteingUeid: subscriberData.ueId});
        axios.all([apiService.deleteSubscriber(this.deleteSubsciberToken.token, subscriberData.ueId)])
            .then(function (res) {
                if (res[0]) {
                    thisView.setState({deleteingUeid: ''});
                    thisView.getSubscribersList();
                }
            }).catch(function (res) {
                console.log(res);
                console.log('An error occurred add subscriber element service');
            });

    }

    enableModifySubscriber = (subscriberData) => {
        this.setState({operationType: "edit", editSubscriberData: subscriberData}, () => {
            this.toggleSubscriber();
        });
        this.toggleSubscribersList();
    }

    modifySubscriber = (subscriberData) => {

        var thisView = this;
        if (this.modifySubscriberToken)
            this.modifySubscriberToken.cancel();
        this.modifySubscriberToken = axios.CancelToken.source();

        console.log(subscriberData);
        let data = {
            ueId: this.state.editSubscriberData.ueId,
            newUeId: subscriberData.supi
        }

        this.setState({callUnderProgress: true});
        axios.all([apiService.modifySubscriber(this.modifySubscriberToken.token, data)])
            .then(function (res) {
                if (res[0]) {
                    thisView.setState({callUnderProgress: false})
                    thisView.toggleSubscriber();
                    thisView.toggleSubscribersList();
                }
            }).catch(function (res) {
                console.log(res);
                console.log('An error occurred add subscriber element service');
                thisView.setState({callUnderProgress: false});
            });

    }

    getSubscribersList = () => {

        var thisView = this;
        if (this.getSubscribersToken)
            this.getSubscribersToken.cancel();
        this.getSubscribersToken = axios.CancelToken.source();

        this.setState({callUnderProgress: true});
        axios.all([apiService.getSubscribers(this.getSubscribersToken.token)])
            .then(function (res) {
                if (res[0]) {
                    if(res[0]["status"] && res[0]["data"]){
                        thisView.setState({subscribersList: res[0]["data"]});
                    }
                    thisView.setState({callUnderProgress: false});
                }
            }).catch(function (res) {
                console.log(res);
                console.log('An error occurred add subscriber element service');
                thisView.setState({callUnderProgress: false});
            });

    }

    suggestedActionUeCheck = () => {
        var thisView = this;
        if (this.suggestedActionTOken)
            this.suggestedActionTOken.cancel();
        this.suggestedActionTOken = axios.CancelToken.source();

        this.setState({callUnderProgress: true});
        axios.all([apiService.suggestedActionUE(this.suggestedActionTOken.token)])
            .then(function (res) {
                if (res[0]) {
                    if(res[0]["data"]){
                        thisView.setState({suggestedActionButton: res[0]["data"]});
                    } else {
                        thisView.setState({suggestedActionButton: null});
                    }
                    thisView.setState({callUnderProgress: false});   
                }
            }).catch(function (res) {
                console.log(res);
                console.log('An error occurred add subscriber element service');
                thisView.setState({callUnderProgress: false});
            });
    }

    suggestedActionUeSubmit = () => {
        var thisView = this;
        if (this.suggestedActionSubmitTOken)
            this.suggestedActionSubmitTOken.cancel();
        this.suggestedActionSubmitTOken = axios.CancelToken.source();

        this.setState({callUnderProgress: true});
        axios.all([apiService.suggestedActionUESubmit(this.suggestedActionSubmitTOken.token)])
            .then(function (res) {
                if (res[0]) {
                    thisView.setState({callUnderProgress: false});   
                }
            }).catch(function (res) {
                console.log(res);
                console.log('An error occurred add subscriber element service');
                thisView.setState({callUnderProgress: false});
            });
    }


    render() {

        const { addSubsciberFormStatus, subscribersListStatus, 
                    ns_id, ns_supi, ns_auth_method, ns_k, ns_operation_code_type, ns_operator_code_value,
                    addSubscriberError, subscribersList, callUnderProgress, deleteingUeid, operationType,
                    editSubscriberData, suggestedActionButton } = this.state;

        return (
            <div className="five-g-manage">
                <Grid container spacing={4}>
                    <Grid item lg={8} xs={12} className="fgm-inner-grid">
                        <Grid container spacing={4}>
                            <Grid item md={6} xs={12} className="fgm-inner-grid">
                                <Widget
                                    title="Manage Core"
                                    upperTitle
                                    bodyclassName={''}
                                    className={'test'}
                                    disableWidgetMenu={true}
                                    fontBold={true}
                                >
                                    <div className="core-data">
                                        <Grid container className="cd-main">
                                            <Grid item xs={4} className="cd-each">
                                                <div className="c100 p33 center">
                                                    <span>33%</span>
                                                    <div className="slice">
                                                        <div className="bar">
                                                        </div>
                                                        <div className="fill">
                                                        </div>
                                                    </div>
                                                </div>
                                                <span>Memory Usage</span>
                                            </Grid>
                                            <Grid item xs={4} className="cd-each">
                                                <div className="c100 p33 center">
                                                    <span>33%</span>
                                                    <div className="slice">
                                                        <div className="bar">
                                                        </div>
                                                        <div className="fill">
                                                        </div>
                                                    </div>
                                                </div>
                                                <span>CPU Usage</span>
                                            </Grid>
                                            <Grid item xs={4} className="cd-each">
                                                <div className="c100 p33 center">
                                                    <span>33%</span>
                                                    <div className="slice">
                                                        <div className="bar">
                                                        </div>
                                                        <div className="fill">
                                                        </div>
                                                    </div>
                                                </div>
                                                <span>Edge Compute Usage- Edge01</span>
                                            </Grid>
                                        </Grid>
                                        <div className="manage-options">
                                            <img src={ArrowBlue} alt="arrow"/>
                                            <span>Add a slice</span>
                                        </div>
                                        <div className="manage-options">
                                            <img src={ArrowBlue} alt="arrow" />
                                            <span>Add an Edge Node</span>
                                        </div>
                                        <div className="manage-options" onClick={() => { this.toggleSubscriber("add")}}>
                                            <img src={ArrowBlue} alt="arrow" />
                                            <span>Add a subscriber</span>
                                        </div>
                                        <div className="manage-options" onClick={this.toggleSubscribersList} >
                                            <img src={ArrowBlue} alt="arrow" />
                                            <span>View Subscribers</span>
                                        </div>
                                    </div>

                                </Widget>
                            </Grid>
                            <Grid item md={6} xs={12} className="fgd-form">
                                <Widget
                                    title="Suggested Actions"
                                    upperTitle
                                    bodyclassName={''}
                                    className={''}
                                    disableWidgetMenu={true}
                                    fontBold={true}
                                >
                                    {
                                        (suggestedActionButton && suggestedActionButton.action_button && suggestedActionButton.action_button === 'yes') ?
                                        <div className="manage-options" onClick={this.suggestedActionUeSubmit}>
                                            <img src={ArrowBlue} alt="arrow" />
                                            <span>{suggestedActionButton.action_button_text}</span>
                                        </div> :
                                        <div className="no-actions">
                                            <span>No Actions</span>
                                        </div>
                                    }

                                </Widget>
                            </Grid>
                            <Grid item md={6} xs={12} className="fgd-form">
                                <Widget
                                    title="Manage RAN"
                                    upperTitle
                                    bodyclassName={''}
                                    className={''}
                                    disableWidgetMenu={true}
                                    fontBold={true}
                                >
                                    <div className="ran-stats">
                                        <div className="rans-each">
                                            <span>150</span>
                                            <span>RRHs</span>
                                        </div>
                                        <div className="rans-each">
                                            <span>200</span>
                                            <span>gNBs</span>
                                        </div>
                                        <div className="rans-each">
                                            <span>1500</span>
                                            <span>subscribers</span>
                                        </div>
                                    </div>
                                    <NavLink to={this.props.match.path + "/addedge"} className="manage-options">
                                        <img src={ArrowBlue} alt="arrow" />
                                        <span>Add a RAN node - gNB</span>
                                    </NavLink>
                                    <NavLink to={this.props.match.path + "/gnodes"} className="manage-options">
                                        <img src={ArrowBlue} alt="arrow" />
                                        <span>View RAN Nodes</span>
                                    </NavLink>
                                </Widget>
                            </Grid>
                            <Grid item md={6} xs={12} className="fgd-form">
                                <Widget
                                    title="Suggested Actions"
                                    upperTitle
                                    bodyclassName={''}
                                    className={''}
                                    disableWidgetMenu={true}
                                    fontBold={true}
                                >
                                    <div className="manage-options">
                                        <img src={ArrowBlue} alt="arrow" />
                                        <span>gNB in CA area is overloaded. Add a new gNB in this area</span>
                                    </div>
                                    <div className="manage-options">
                                        <img src={ArrowBlue} alt="arrow" />
                                        <span>Remove gNB123. No traffic sincepast 72 hrs.</span>
                                    </div>
                                </Widget>
                            </Grid>
                        </Grid>

                    </Grid>
                    <Grid item lg={4} xs={12} className="fgm-inner-grid">
                        <Grid item xs={12} className="fgd-form">
                            <Timeline align={"left"}>
                                <Timeline.Item>
                                    <p>21 Mar 2022 11:38 hrs</p>
                                    <p>Request additional AMF node for slice 2.</p>
                                </Timeline.Item>
                                <Timeline.Item>
                                    <p>20 Mar 2022 12:30 hrs</p>
                                    <p>Added a RAN node gNB at CA location.</p>
                                    <p>Nagamanoj K.</p>
                                </Timeline.Item>
                                <Timeline.Item>
                                    <p>19 Mar 2022 09:30 hrs</p>
                                    <p>Major system upgrade installed.</p>
                                </Timeline.Item>
                                <Timeline.Item>
                                    <p>17 Mar 2022 20:30 hrs</p>
                                    <p>New AMF added to slice 3.</p>
                                    <p>Pradgnya K.</p>
                                </Timeline.Item>
                                <Timeline.Item>
                                    <p>14 Mar 2022 22:33 hrs</p>
                                    <p>Additional capacity for SMF approved.</p>
                                    <p>Sandeep M.</p>
                                </Timeline.Item>
                                <Timeline.Item>
                                    <p>13 Mar 2022 06:20 hrs</p>
                                    <p>New software upgrades available.</p>
                                </Timeline.Item>
                            </Timeline>
                        </Grid>
                    </Grid>

                </Grid>

                <Dialog open={addSubsciberFormStatus} id="add-subscriber-form">
                    <DialogTitle>
                        { operationType === 'add' ? "New Subscriber" : `Edit Subscriber - ${editSubscriberData ? editSubscriberData.ueId : ''}` }
                        <Icons.Close fontSize={"small"} className="adf-close-icon" onClick={this.toggleSubscriber} />
                    </DialogTitle>
                    <DialogContent>
                        <Grid className="asf-container" container spacing={2}>
                            <Grid item md={6} xs={12} className="fgd-form">
                                <div className="asf-each">
                                    <span>ID</span>
                                    <input type="text" spellCheck="false" name="ns_id"
                                        value={ns_id} onChange={this.handleChange} onKeyDown={this.handleChange}/>
                                </div>
                            </Grid>
                            <Grid item md={6} xs={12} className="fgd-form">
                                <div className="asf-each">
                                    <span>SUPI</span>
                                    <input type="text" name="ns_supi" spellCheck="false"
                                        value={ns_supi} onChange={this.handleChange} onKeyDown={this.handleChange}/>
                                </div>
                            </Grid>
                            <Grid item md={6} xs={12} className="fgd-form">
                                <div className="asf-each">
                                    <span>Authentication Method</span>
                                    <input type="text" name="ns_auth_method" spellCheck="false"
                                        value={ns_auth_method} onChange={this.handleChange} onKeyDown={this.handleChange}/>
                                </div>
                            </Grid>
                            <Grid item md={6} xs={12} className="fgd-form">
                                <div className="asf-each">
                                    <span>k</span>
                                    <input type="text" name="ns_k" spellCheck="false"
                                        value={ns_k} onChange={this.handleChange} onKeyDown={this.handleChange}/>
                                </div>
                            </Grid>
                            <Grid item md={6} xs={12} className="fgd-form">
                                <div className="asf-each ns_operation_codes">
                                    <span>Operator Code Type</span>
                                    <FormControl className={""}>
                                        <Select
                                            value={ns_operation_code_type}
                                            onChange={this.handleChangeOperationCode}
                                            displayEmpty
                                            className={""}
                                            inputProps={{ 'aria-label': 'Without label' }}
                                        >
                                            <MenuItem value="">Select Operation Code Type</MenuItem>
                                            <MenuItem value={"op"}>OP</MenuItem>
                                            <MenuItem value={"opc"}>OPC</MenuItem>
                                        </Select>
                                    </FormControl>
                                </div>
                            </Grid>
                            <Grid item md={6} xs={12} className="fgd-form">
                                <div className="asf-each">
                                    <span>Operator Code Value</span>
                                    <input type="text" name="ns_operator_code_value" spellCheck="false"
                                        value={ns_operator_code_value} onChange={this.handleChange} onKeyDown={this.handleChange}/>
                                </div>
                            </Grid>
                            {
                                addSubscriberError && addSubscriberError !== '' &&
                                <Grid item xs={12} className="fgd-form">
                                    <div className="asf-each ns-error">
                                        <span>{addSubscriberError}</span>
                                    </div>
                                </Grid>
                            }
                        </Grid>
                    </DialogContent>
                    <DialogActions>
                        {
                            callUnderProgress ?
                            <img src={loadingIcon} className="call_under_progress_icon" /> :
                            <Button onClick={this.addNewSubscriber} color="primary">
                                { operationType === 'add' ? "Submit" : "Update" }
                            </Button>
                        }

                    </DialogActions>
                </Dialog>

                <Dialog open={subscribersListStatus} id="subscriber-list">
                    <DialogTitle>
                        Subscribers
                        {
                            callUnderProgress && <img src={loadingIcon} className="call_under_progress_icon" />
                        }
                        <Icons.Close fontSize={"small"} className="sl-close-icon" onClick={this.toggleSubscribersList} />
                    </DialogTitle>
                    <DialogContent>
                        <Grid className="sl-container" container spacing={2}>
                            <Grid item xs={12} className="fgd-form">
                                {
                                    subscribersList && subscribersList.length > 0 &&
                                    subscribersList.map((eachSub, index) => {
                                        return (
                                            <div key={index} className="slc-each">
                                                <span>{index+1}</span>
                                                <span>{eachSub.ueId}</span>
                                                <div className="slce-action"> 
                                                    <span className="slca-option" onClick={() => { this.deleteSubscriber(eachSub) }}>
                                                        { 
                                                            (deleteingUeid !== '' && deleteingUeid === eachSub.ueId) ? 
                                                            <img src={loadingIcon} className="call_under_progress_icon" />  
                                                            : 'Delete'
                                                        }
                                                    </span>
                                                </div>
                                                <div className="slce-action"> 
                                                    <span className="slca-option" onClick={() => { this.enableModifySubscriber(eachSub)}}>
                                                        Modify
                                                    </span>
                                                </div>
                                            </div>
                                        )
                                    })
                                }
                            </Grid>
                        </Grid>
                    </DialogContent>
                    <DialogActions>
                        {/* <Button onClick={this.toggleSubscribersList} color="primary">
                            Submit
                        </Button> */}
                    </DialogActions>
                </Dialog>

            </div>
        )
    }
}

export default MonitorNetwork;
